import React from 'react';

function CircularSkill({ skillName, level }){
  // Calculate the percentage to represent skill level
  const percentage = (100);

  return (
    <div className="circular-skill-bar">
    <div className="circular-skill-bar-progress">
      <div className="circular-skill-bar-fill" style={{ transform: `rotate(${percentage * 3.6}deg)` }}></div>
    </div>
    <div className="circular-skill-bar-label">
      {skillName}: {percentage}%
    </div>
  </div>
  );
};

export default CircularSkill;
